import SearchBar from "../SearchBar/SearchBar"
import styles from "./Nav.module.css"
import React from 'react';
import { Link } from 'react-router-dom';



const Nav = (props) => {
    const { onSearch } = props
    return (
        <>
            <SearchBar onSearch= {onSearch}>
            <NavItems></NavItems>
            </SearchBar>
            
            
            
        </>
    )
}

function NavItems() {
    return (
        <div >

            <Link className={styles.nav} to="/about">About</Link>
            <Link className={styles.nav} to="/home">Home</Link>
        </div>
    );
  }

export default Nav
